```solidity
pragma solidity ^0.6.12;

contract MyContract {
    mapping(address => uint256) public ownednumbers;
    mapping(address => uint256) public earnings;
    mapping(address => uint256) public deadbids;
    mapping(uint256 => string) private tokenURI;
    address private owner;
    uint256 public houseearnings;

    constructor() public {
        owner = msg.sender;
    }

    function withdrawHouseEarnings() external {
        require(msg.sender == owner, "Only the owner can withdraw house earnings.");
        uint256 amount = houseearnings;
        houseearnings = 0;
        payable(owner).transfer(amount);
    }

    function placeBuyNowOffer(uint256 _tokenuri, uint256 _offer) external {
        require(_offer >= 0x38d7ea4c68000, "Offer must be greater than or equal to 0x38d7ea4c68000");
        tokenURI[_tokenuri] = "";
    }

    function withdrawEarnings() external {
        uint256 amount = earnings[msg.sender];
        earnings[msg.sender] = 0;
        payable(msg.sender).transfer(amount);
    }

    function cancelBid(uint256 _tokenuri) external {
        deadbids[_tokenuri] += _tokenuri;
        _tokenuri = 0;
    }

    function withdrawDeadBids() external {
        uint256 amount = deadbids[msg.sender];
        deadbids[msg.sender] = 0;
        payable(msg.sender).transfer(amount);
    }

    function placeNewBid(uint256 _tokenuri) external payable {
        require(_tokenuri > 0, "TokenURI must be greater than 0");
        require(msg.value >= 0x38d7ea4c68000, "Value must be greater than or equal to 0x38d7ea4c68000");
        require(msg.value > (_tokenuri + 0x38d7ea4c68000), "Value must be greater than tokenuri + 0x38d7ea4c68000");
        deadbids[_tokenuri] += _tokenuri;
        if (msg.value >= 0x38d7ea4c68000) {
            _tokenuri = 0;
        }
    }

    function updateMessage(uint256 _tokenuri, string calldata _message) external {
        require(keccak256(abi.encodePacked(2+keccak256(abi.encodePacked(_tokenuri,0)))) + ((31+(_tokenuri/2))/32) > keccak256(abi.encodePacked(2+keccak256(abi.encodePacked(_tokenuri,0)))), "Condition not met");
        tokenURI[_tokenuri] = _message;
    }

    function takeNumber(uint256 _tokenuri) external {
        require(!(keccak256(abi.encodePacked(2+keccak256(abi.encodePacked(_tokenuri,0)))) + ((31+(_tokenuri/2))/32) > keccak256(abi.encodePacked(2+keccak256(abi.encodePacked(_tokenuri,0)))), "Condition not met");
        tokenURI[_tokenuri] = "";
        if (_tokenuri <= 0) {
            ownednumbers[msg.sender] = 0;
        }
    }

    function cancelBuyNowOffer(uint256 _tokenuri) external {
        tokenURI[_tokenuri] = "";
    }

    function acceptBid(uint256 _tokenuri) external {
        require(_tokenuri > 0, "TokenURI must be greater than 0");
        require(_tokenuri != 0, "TokenURI must not be zero");
        earnings[_tokenuri] += (_tokenuri - (_tokenuri/100));
        houseearnings += (_tokenuri/100);
        deadbids[_tokenuri] += _tokenuri;
        if (_tokenuri > 0 && _tokenuri != 0 && ownednumbers[_tokenuri] - 1 < ownednumbers[_tokenuri] && _tokenuri <= ownednumbers[_tokenuri]) {
            _tokenuri = 0;
        }
    }

    function acceptBuyNowOffer(uint256 _tokenuri) external payable {
        require(_tokenuri > 0, "TokenURI must be greater than 0");
        require(msg.value == _tokenuri, "Value must be equal to tokenuri");
        earnings[_tokenuri] += (msg.value - (msg.value/100));
        houseearnings += (msg.value/100);
        deadbids[_tokenuri] += _tokenuri;
        if (_tokenuri > 0 && msg.value == _tokenuri && _tokenuri == _tokenuri && ownednumbers[_tokenuri] - 1 < ownednumbers[_tokenuri] && _tokenuri <= ownednumbers[_tokenuri]) {
            _tokenuri = 0;
            ownednumbers[_tokenuri] = 0;
        }
    }
}
```

